import React, { useState, useEffect } from 'react';
import { Text } from "react-native";
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import OnboardingSwiper from './src/components/OnboardingSwiper'
import Home from './src/containers/Home'
import Login from './src/containers/LoginScreen/Login'
import Registration from './src/containers/RegistrationScreen/Registration'
import { CurrentUserProvider } from './src/CurrentUserContext'
import AppNavigator from './src/AppNavigator';

const HomeNav = createStackNavigator();

// Use Stack Navigator to navigate to various pages in app
function App() {

  return (
    <NavigationContainer>
      <CurrentUserProvider>
        <HomeNav.Navigator>
          <HomeNav.Screen name="AppNavigator" component={AppNavigator} />
        </HomeNav.Navigator>
      </CurrentUserProvider>
    </NavigationContainer>

  );
}


export default App;
